vršinom, ugradjenim zvučnikom, i jackom za slušalice samo je deo inovacija. Ukoliko imate PS Vita konzolu, možete preko nje igrati igre koje imate na Playstation 4. PS4 poseduje mogućnost da koristi izdvojene ekrane na mobilnim uredjajima poput Android telefona i tablet računara.',41990,NULL,0,'CON0012','uploads/product/OcXnx6lTfhHSImlh.jpg',NULL,NULL,NULL,NULL,'',NULL,'2015-01-01 00:07:57','2015-01-01 00:07:57',NULL),(3952,40,2,20,'PlayStation PS4 1TB Slim','sony-playstation-ps4-1tb-slim','Osam jezgara AMD-ovog procesora i 8GB GDDR5 memorije pokreću najnoviju konzolu iz Sony-ja. Novi redizajnirani Dualshock 4 sa touch površinom, ugradjenim zvučnikom, i jackom za slušalice samo je deo inovacija. Ukoliko imate PS Vita konzolu, možete preko nje igrati igre koje imate na Playstation 4. PS4 poseduje mogućnost da koristi izdvojene ekrane na mobilnim uredjajima poput Android telefona i tablet računara.',50900,NULL,0,'CON0013','uploads/product/vUP1WAs8vBGNsWwI.jpg',NULL,NULL,NULL,NULL,'',NULL,'2015-01-01 00:07:58','2015-01-01 00:07:58',NULL),(3955,41,2,20,'XBOXONE Console 500GB','microsoft-xboxone-console-500gb','Za razliku od Sony-a, počeli su od same konzole: Xbox One sledi stil iz Windows-a 8 i umesto zaobljenog Xbox-a 360 ima oštrije ivice. Crna boja je i dalje dominantna. Hardver je praktično ono što smo i očekivali: CPU od 8 jezgara, 8 GB RAM-a i nešto što Microsoft naziva tri operativna sistema, koji se smenjuju bez prekida. To praktično znači da sa novim Xbox-om možete gledati film, a u sledećem trenutku nastaviti Call of Duty tačno tamo gde ste stali. Prikazano je i nekoliko igara: Remedy-ev Quantum Break koji je ispresecan sa \'pravim\' glumcima, Forza Motorsport 5 koji će se udaljiti od staza i konačno preći na ulice, i naravno sve moguće sportske igre - NBA, FIFA, UFC i sve ostale EA Sports igre sada koriste EA Sports Ignite, engine koji omogućuje do sada neviđen realizam. Halo dobija pravu pravcatu seriju, ohrabren Forward Unto Dawn-om, a prikazan je i Call of