hi ventilatori od 120mm, jedan sa PWM funkcijom, nude savrsenu ravnotezu izmedu protok vazduha i buke. \r\nVisoko polirana bakarna baza koja cini savrsen kontakt sa povrsinom CPU-a kako bi postigla optimalne performanse hladenja. \r\n\r\nNEPTVIN V2 je specijalizovani CPU Cooler sa 6 toplotnih cevi. NEPTVIN je prvi CPU hladnjak dizajniran da podrzi visestruku kontrolu PWM ventilatora cine NEPTVIN jedan od najboljih hladnjaka za CPU i odlicno toplotno resenje za gaming racunare. \r\n\r\nKompatibilnost sa univerzalnim socketima, sa vise klipova za podrsku Intel LGA2011/1366/1156/1155/1151/1150/775 and AMD AM4*/AM3+/AM3/AM2+/AM2/FM2+/FM2/FM1. \r\n\r\n\r\nDimenzije: 126X136X159mm(sa kulerom) \r\nDimenzija kulera: 120X120X25mm(1kom)/120X120X25mm(1kom) \r\nNeto tezina: 1100g \r\nBearing Type: Hydro Bearing \r\nVoltaza: 12VDC \r\nRadna voltaza: 10.8~13.2VDC \r\nPocetna voltaza: 7VDC \r\nStrija:	0.2�10%A / 0.19�10%A(MAX) \r\nUlazna snaga: 2.4W / 2.28W \r\nBrzina kulera: 1300�10%RPM / 900�150~1500�10%RPM \r\nMax. Air Flow: 65.16CFM / 74.34CFM \r\nBuka: 26.1dB(A) / 17.8~30dB(A)',6400,NULL,0,'COO1375','uploads/product/LSJmpumgkJj8dqoL.jpg','uploads/product/5QkcPA2VcSVHQMDQ.jpg',NULL,NULL,NULL,'http://www.deepcool.com/product/cpucooler/2014-03/7_813.shtml',NULL,'2015-01-01 00:34:53','2015-01-01 00:34:53',NULL),(7272,19,2,13,'LUCIFER V2','deepcool-lucifer-v2','Lucifer CPU hladnjak je dizajniran da ohladi mainstream procesore u rezimu bez ventilatora, cime se postizu nulti sistemi buke. \r\n6 bakarnih toplotnih cevi su obezbedene u asimetricnom rasporedu kako bi se obezbedilo ciscenje komponenata memorije. \r\nPatentirani ventilator od 14cm (ukljucen u proizvod) dodatno povecava kapacitet hladenja do 300W. \r\nVisoko polirana bakarna baza koja cini savrsen kontakt sa povrsinom CPU-a kako bi postigla optimalne performanse hladenja. \r\nDa bi se postigao najbrzi prenos toplote, baza bakra je CNC obradena da stvori poliranu, blago konveksnu povrsinu. \r\nOpremljen sa vise klipova za 